  SLF_VERM_3 TINYINT(1) DEFAULT NULL COMMENT ' Allgemeine Sicherheitshinweise',
  SLF_VERM_4 TINYINT(1) DEFAULT NULL COMMENT ' Patient nimmt am persönlichen Betreuungsmodell von Lilly teil\\n',
  SLF_VERM_5 TINYINT(1) DEFAULT NULL COMMENT 'Erläuterungen des Pens/Injektors und seiner Bauteile sowie seiner Funktionen anhand der Bedienungsanleitung',
