  SLF_VERM_7 TINYINT(1) DEFAULT NULL COMMENT '  (ggf.) Erläuterung des Patronenwechsels und sonstige Pflegehinweise  \\n',
  SLF_VERM_8 TINYINT(1) DEFAULT NULL COMMENT 'Einführung in die richtige Spritzentechnik ',
  SLF_VERM_9 TINYINT(1) DEFAULT NULL COMMENT 'Betreuungsprogramm vorgestellt und Vorteile erklärt',
  SLF_VERM_10 TINYINT(1) DEFAULT NULL COMMENT 'Beantwortung von Fragen: Fragen ausschließlich  zum Injektor beantwortet, Bei Fragen zur Medikation oder zur Erkrankung wendet sich der Patient, an den behandelnden Arzt/ die behandelnde Ärztin',
  SLF_FAHRZEIT DATETIME DEFAULT NULL,
  SLF_GES_KM VARCHAR(45) BINARY DEFAULT NULL,
  SLF_ANRUFE INT(2) DEFAULT NULL,
  SLF_ADMINPAUSCHALE TINYINT(1) DEFAULT NULL,
  SLF_ARZT_ID TINYINT(10) DEFAULT NULL,
  SLF_BESONDERHEIT VARCHAR(512) BINARY DEFAULT NULL,
  SLF_FAHRTZEIT_STD INT(2) DEFAULT NULL,
  SLF_FAHRTZEIT_MIN INT(2) DEFAULT NULL,
  PRIMARY KEY (SLF_ID)
)
ENGINE = MYISAM
AUTO_INCREMENT = 5
AVG_ROW_LENGTH = 44
CHARACTER SET utf8
COLLATE utf8_bin;

